window.bookSummaryJSON = "<p>Seraphina Delaney is a competent, successful woman, but she has always known that an inner five-year-old lurked beneath the surface, hidden from the world. </p> <p>Lee Randall, her best friend's brother, was intrigued from the moment he met Sera. When she, uncharacteristically, lets her little side out with him, he reveals to her that he has always wanted to be a Daddy to a grown-up little girl. </p> <p>Lee wants all of Sera, big and little. Has she finally found the man who can fulfill all her fantasies? </p>"; 
